import React from 'react'
import { NewTournament } from './NewTournament'
import {BrowserRouter, Route, Routes} from 'react-router-dom'

const App=()=>{
  return(
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<h1>HOME Page</h1>}/>
        </Routes>
      </BrowserRouter>
  )
}

export default App
